CREATE PROCEDURE [dbo].[dsi_sp_BuildDriverTables_E2DOEBSWIF]
    @SystemID char(12)
AS
SET NOCOUNT ON;
/**********************************************************************************
Client Name: The Doe Run Resources Corporation

Created By: Marie Thomerson
Business Analyst: Lea King
Create Date: 11/09/2022
Service Request Number: TekP-2022-08-15-02

Purpose: Bswift Demographic TEST 

Revision History
----------------
Update By           Date           Request Num        Desc
Darren              XX/XX/2022     SR-2022-000XXXXX   XXXXX
Marie Waters        09/29/2023     TekP-2023-08-07-01 Populate Employment Field3 and Employment Field3 Effective Date

SELECT * FROM dbo.U_dsi_Configuration WHERE FormatCode = 'E2DOEBSWIF';
SELECT * FROM dbo.U_dsi_SqlClauses WHERE FormatCode = 'E2DOEBSWIF';
SELECT * FROM dbo.U_dsi_Parameters WHERE FormatCode = 'E2DOEBSWIF';
SELECT ExpFormatCode, ExpExportCode, ExpStartPerControl, ExpEndPerControl,* FROM dbo.AscExp WHERE expFormatCode = 'E2DOEBSWIF';
SELECT * FROM dbo.U_dsi_InterfaceActivityLog WHERE FormatCode = 'E2DOEBSWIF' ORDER BY RunID DESC;

--Update Dates
UPDATE dbo.AscExp
    SET expLastStartPerControl = '202201021'
       ,expStartPerControl     = '202201021'
       ,expLastEndPerControl   = '202211099'
       ,expEndPerControl       = '202211099'
WHERE expFormatCode = 'E2DOEBSWIF';

Execute Export
--------------
EXEC dbo.dsi_sp_TestSwitchbox_v2 'E2DOEBSWIF', 'ONDEM_XOE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'E2DOEBSWIF', 'TEST_XOE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'E2DOEBSWIF', 'OEPASSIVE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'E2DOEBSWIF', 'OEACTIVE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'E2DOEBSWIF', 'SCH_E2DOEB';

EXEC dbo._dsi_usp_ExportRipOut_v7_4 @FormatCode = 'E2DOEBSWIF', @AllObjects = 'Y', @IsWeb = 'Y'
**********************************************************************************/
BEGIN

    --==========================================
    -- Declare variables
    --==========================================
    DECLARE  @FormatCode        VARCHAR(10)
            ,@ExportCode        VARCHAR(10)
            ,@StartDate         DATETIME
            ,@EndDate           DATETIME
            ,@StartPerControl   VARCHAR(9)
            ,@EndPerControl     VARCHAR(9)
            ,@Last52WeekPerControl as VARCHAR(10) ;

    -- Set FormatCode
    SELECT @FormatCode = 'E2DOEBSWIF';

    -- Declare dates from Parameter file
    SELECT
         @StartPerControl = StartPerControl
        ,@EndPerControl   = EndPerControl
        ,@StartDate       = LEFT(StartPerControl,8)
        ,@EndDate         = DATEADD(S,-1,DATEADD(D,1,LEFT(EndPerControl,8)))
        ,@ExportCode      = ExportCode
    FROM dbo.U_dsi_Parameters WITH (NOLOCK)
    WHERE FormatCode = @FormatCode;

     SELECT @Last52WeekPerControl =  CONVERT(VARCHAR(12),DATEADD(week,-52, @StartDate),112) + '1'
    PRINT 'Last 52 Weeks ' + @Last52WeekPerControl

    --==========================================
    -- Clean EE List 
    -- Caution: Careful of cleaning EE List if including paycheck data
    --==========================================

    -- Cleans EE List of terms where EE active in another company (transfer), or active in more than one company
    DELETE FROM dbo.U_E2DOEBSWIF_EEList
    WHERE xCoID <> dbo.dsi_BDM_fn_GetCurrentCOID(xEEID)
    AND xEEID IN (SELECT xEEID FROM dbo.U_E2DOEBSWIF_EEList GROUP BY xEEID HAVING COUNT(1) > 1);

    --==========================================
    -- Audit Section
    --==========================================
    -- Get data from audit fields table. Add fields here if auditing
    IF OBJECT_ID('U_E2DOEBSWIF_AuditFields','U') IS NOT NULL
        DROP TABLE dbo.U_E2DOEBSWIF_AuditFields;
    CREATE TABLE dbo.U_E2DOEBSWIF_AuditFields (aTableName varchar(30),aFieldName varchar(30));


    -- Create audit table based on fields defined above
    IF OBJECT_ID('U_E2DOEBSWIF_Audit','U') IS NOT NULL
        DROP TABLE dbo.U_E2DOEBSWIF_Audit;
    SELECT 
        audEEID  = audKey1Value
        ,audKey2 = audKey2Value
        ,audKey3 = audKey3Value
        ,audTableName
        ,audFieldName
        ,audAction
        ,audDateTime
        ,audOldValue
        ,audNewValue
        ,audRowNo = ROW_NUMBER() OVER (PARTITION BY audKey1Value, audKey2Value, audKey3Value, audFieldName ORDER BY audDateTime DESC)
        ,audEmplStatus = CASE WHEN audTableName = 'EmpComp' AND audFieldName = 'EecEmplStatus' AND audNewValue <> audOldValue THEN 'Y' ELSE 'N' END
        ,audHourlyorSalary = CASE WHEN audTableName = 'EmpComp' AND audFieldName = 'EecSalaryOrHourly' AND audNewValue <> audOldValue THEN 'Y' ELSE 'N' END
        ,audDedGroupCode = CASE WHEN audTableName = 'EmpComp' AND audFieldName = 'EecDedGroupCode' AND audNewValue <> audOldValue THEN 'Y' ELSE 'N' END
        ,audCoID = CASE WHEN audTableName = 'EmpComp' AND audFieldName = 'EecCOID' AND audNewValue <> audOldValue  THEN 'Y' ELSE 'N' END
    INTO dbo.U_E2DOEBSWIF_Audit
    FROM dbo.vw_AuditData WITH (NOLOCK) 
    JOIN dbo.U_E2DOEBSWIF_AuditFields WITH (NOLOCK) 
        ON audTableName = aTableName
        AND audFieldName = aFieldName
    WHERE audDateTime BETWEEN @StartDate AND @EndDate
    AND audAction <> 'DELETE';

    -- Create Index
    CREATE CLUSTERED INDEX CDX_U_E2DOEBSWIF_Audit ON dbo.U_E2DOEBSWIF_Audit (audEEID,audKey2);

