    IF OBJECT_ID('U_E2DOEBSWIF_drvTbl','U') IS NOT NULL
        DROP TABLE dbo.U_E2DOEBSWIF_drvTbl;
   SELECT DISTINCT
         drvEEID = xEEID
        ,drvCoID = xCoID
        ,drvDepRecID = '1' --DELETE IF NOT USING DEPENDENT DATA
        ,drvSort = EecEmpNo
        -- standard fields above and additional driver fields below
        ,drvssn = eepSSN
        ,drvempno = EecEmpNo
        ,drvRelation = 'E'
        ,drvnamefirst = EepNameFirst
        ,drvnamelast = dbo.dsi_fnRemoveChars('.,/', EepNameLast)      
        ,drvBenefitClassCode = CASE WHEN EecDedGroupCode = 'NBEN' THEN 'NBE' ELSE
                                    CASE WHEN cmpcompanycode = 'FPI' and EecSalaryOrHourly = 'H' THEN 'FPI1'
                                    WHEN cmpcompanycode = 'FPI' and EecSalaryOrHourly = 'S' THEN 'FPI2'  --'FPI'  --updated per vendor 1/25/23
                                    WHEN cmpcompanycode = 'DRC' and EecSalaryOrHourly = 'H' THEN 'FT-Hourly'
                                    WHEN cmpcompanycode = 'DRC' and EecSalaryOrHourly = 'S' THEN 'FT-Salaried'
                                    END END
        ,drvBenefitClassDate = CASE WHEN audHourlyorSalary = 'Y' THEN audHourlyorSalaryDate WHEN audDedGroupCode = 'Y' THEN audDedGroupCodeDate WHEN audCoID = 'Y' THEN audCoIDDate END
        ,drvCompensationDate =   dbo.dsi_fnlib_GetAnnSalary_EffDate(EecEEID, EecCOID, EecDateOfLastHire) 
        ,drvannsalary = FORMAT(EecAnnSalary, '###0.00')
        ,drvHourlyRate = CASE WHEN EecSalaryOrHourly = 'H' THEN FORMAT(EecHourlyPayRate,'#00.00') END
        ,drvHoursPerWeek = CASE WHEN EecSalaryOrHourly = 'H' THEN '40' END
        ,drvnamemiddle = LEFT(EepNameMiddle,1)
        ,drvnamesuffix = NULLIF(EepNameSuffix,'Z')
        ,drvconssn = eepSSN
        ,drvDateofBirth = EepDateOfBirth
        ,drvGender = EepGender
        ,drvDisabled = CASE WHEN eepIsDisabled = 'Y' THEN '1' ELSE '0' END
        ,drvEthnicity = CASE    WHEN eepEthnicID = '1' THEN '5' 
                                WHEN eepEthnicID = '2' THEN '4'
                                WHEN eepEthnicID = '3' THEN '6'
                                WHEN eepEthnicID = '5' THEN '1'
                                WHEN eepEthnicID = '6' THEN '2'
                                WHEN eepEthnicID = '7' THEN '3'
                                WHEN eepEthnicID = '8' THEN '8' 
                                else '7' END
        ,drvMaritalStatus = CASE    WHEN eepMaritalStatus = 'W' THEN '5'
                                    WHEN eepMaritalStatus = 'D' THEN '1' 
                                    WHEN eepMaritalStatus = 'M' THEN '3'
                                    WHEN eepMaritalStatus not in ('W', 'D', 'M') THEN '4'
                                    END
        ,drvVerifiedDependent = ''
        ,drvdateoforiginalhire = EecDateOfOriginalHire
        ,drvdateoflasthire = CASE WHEN EecDateOfOriginalHire <> EecDateOfLastHire THEN EecDateOfLastHire END
        ,drvTimeStatus = CASE    WHEN eecEEtype = 'INT' and EecSalaryOrHourly = 'H' THEN '8'
                                WHEN eecEEtype = 'INT' and EecSalaryOrHourly = 'S' THEN '10'
                                WHEN eecEEtype <>'INT' and EecSalaryOrHourly = 'S' and EecFullTimeOrPartTime = 'F' THEN '1'
                                WHEN eecEEtype <>'INT' and EecSalaryOrHourly = 'H' and EecFullTimeOrPartTime = 'P' THEN '2'
                                WHEN eecEEtype <>'INT' and EecSalaryOrHourly = 'H' and EecFullTimeOrPartTime = 'F' THEN '5'
                                WHEN eecEEtype <>'INT' and EecSalaryOrHourly = 'S' and EecFullTimeOrPartTime = 'P' THEN '6'
                                END
        ,drvPayFrequency = CASE WHEN PgrPayFrequency = 'S' THEN '2' 
                                WHEN PgrPayFrequency = 'W' THEN '4'
                                END
        ,drvAddressEMail = EepAddressEMail
        ,drvJobTitle =  dbo.dsi_fnRemoveChars('.,/',JbcDesc)
        ,drvaddressline1 = EepAddressLine1
        ,drvaddressline2 = EepAddressLine2
        ,drvaddresscity = EepAddressCity
        ,drvaddressstate = EepAddressState
        ,drvaddresszipcode = EepAddressZipCode
        ,drvHomePhone = EepPhoneHomeNumber
        ,drvCellPhone = dbo.dsi_fnlib_GetPhoneNumber(EepEEID, 'CEL') 
        ,drvLOAStartDate =  CASE WHEN EecEmplStatus = 'A' AND EshEmplStatus = 'L' AND EshStatusStartDate is not null and EshStatusStopDate between @StartDate AND @EndDate THEN EshStatusStartDate
                                WHEN EecEmplStatus = 'L' AND EecEmplStatusStartDate is not null THEN EecEmplStatusStartDate END
                            --CASE WHEN EecEmplStatus = 'L' AND EecEmplStatusStartDate is not null THEN EecEmplStatusStartDate END
        ,drvLOAEndDate = CASE WHEN EecEmplStatus = 'L' AND EecEmplStatusStartDate is not null THEN EecStatusExpectedEndDate 
                            WHEN EecEmplStatus = 'A' AND EshEmplStatus = 'L' AND EshStatusStopDate is not null and EshStatusStopDate between @StartDate AND @EndDate THEN EshStatusStopDate END
                            --WHEN EecEmplStatus = 'A' AND EshEmplStatus = 'L' AND EshStatusStopDate is not null THEN EshStatusStopDate END
        ,drvLOAStatus = CASE WHEN EecEmplStatus = 'L' AND EecLeaveReason IN ('100', '101','102','103','104') THEN '1'
                            WHEN EecEmplStatus = 'L' AND EecLeaveReason = '300' then '2'
                            WHEN EecEmplStatus = 'L' AND EecLeaveReason = '200' then '7' 
                            WHEN EecEmplStatus = 'L' AND EecLeaveReason = '400' then '8'
                            WHEN EecEmplStatus = 'L' AND EecLeaveReason = '325' then '4'
                            WHEN EecEmplStatus = 'L' AND EecLeaveReason = '350' then '6' 
                            else ''
                        END
                            
        ,drvEmplStatus = CASE WHEN EecEmplStatus = 'T' AND eectermreason <> 'TRO' THEN 'T' ELSE 'A' END
        ,drvTermReason = CASE 
                            WHEN EecEmplStatus = 'T' AND eectermreason = '203' THEN '4'
                            WHEN EecEmplStatus = 'T' AND eectermreason = '202' THEN '2'
                            WHEN EecEmplStatus = 'T' AND eectermreason = '118' THEN '10'
                            WHEN EecEmplStatus = 'T' AND eectermreason = '110' THEN '29'
                            WHEN EecEmplStatus = 'T' AND eectermreason = '300' THEN '31'
                            WHEN EecEmplStatus = 'T' AND eectermreason = '209' THEN '18'
                            WHEN EecEmplStatus = 'T' AND eectermreason = '109' THEN '3'
                            WHEN EecEmplStatus = 'T' AND eectermreason in ('106', '107', '108') THEN '11'
                            else CASE   WHEN eecemplstatus = 'T' and eectermtype = 'V' THEN '14'
                                        WHEN eecemplstatus = 'T' and eectermtype = 'I' THEN '12'
                                        WHEN eecemplstatus = 'T' and eectermtype not in ('I' ,'V') THEN '1' 
                                        END 
                            END
        ,drvTerminationDate = CASE WHEN EecEmplStatus = 'T' AND eectermreason <> 'TRO' THEN EecDateOfTermination END
        ,drvLocation = dbo.dsi_fnRemoveChars('.,/',LocDesc)
        ,drveecorglvl1 = EecOrgLvl1
        ,drveecorglvl2 = EecOrgLvl2
        ,drvEmployField3 = CONVERT(VARCHAR,dbo.dsi_fnPadZero( CONVERT(DECIMAL(4,0),PehCurHrs),4,0))  --MW Added 9/29/2023
        ,drvEmployField3EffDate = Convert(varchar, PrgPayDate , 101) --MW Added 9/29/2023
        ,drvEND = ',,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,'
    INTO dbo.U_E2DOEBSWIF_drvTbl
    FROM dbo.U_E2DOEBSWIF_EEList WITH (NOLOCK)
    JOIN dbo.vw_int_EmpComp WITH (NOLOCK)
        ON EecEEID = xEEID 
        AND EecCoID = xCoID
        AND eecEEtype <> 'CON'
                 And (eecemplstatus <> 'T' OR (eecemplstatus = 'T' and eectermreason <> 'TRO'
          and EXISTS (Select 1 from dbo.U_E2DOEBSWIF_Audit where audEEID = xEEID and audfieldname = 'eecemplstatus' and audNewValue = 'T')))
    JOIN dbo.EmpPers WITH (NOLOCK)
        ON EepEEID = xEEID
    LEFT JOIN (
                SELECT EshEEID, EshCOID, EshStatusStartDate, EshStatusStopDate, EshEmplStatus
                FROM (
                        SELECT EshEEID, EshCOID, EshStatusStartDate, EshStatusStopDate, EshEmplStatus, ROW_NUMBER() OVER (PARTITION BY EshEEID, EshCOID ORDER BY EshStatusStartDate DESC) AS RN
                        FROM dbo.EmpHStat WITH (NOLOCK) 
                        WHERE EshEmplStatus = 'L' and EshIsCurrent = 'N') AS LOA_Dates 
                WHERE RN = 1) AS EshDates 
        ON EshEEID = xEEID 
        AND EshCOID = xCOID
    JOIN dbo.PayGroup WITH (NOLOCK)
        ON Pgrpaygroup = EecPayGroup
    JOIN dbo.JobCode WITH (NOLOCK)
        ON JbcJobCode = EecJobCode
    JOIN dbo.Location WITH (NOLOCK)
        ON LocCode = EecLocation
    JOIN dbo.Company WITH (NOLOCK)
        On CmpCOID = xCoID
    LEFT JOIN dbo.U_E2DOEBSWIFL_PEarHist -- MW Added 9/29/2023
        on PehEEID =  xeeid
        --AND CmpCOID in ('NZNYC','NZNW3')
    LEFT JOIN (SELECT DISTINCT audEEID, audKey2
                ,MAX(CASE WHEN audEmplStatus = 'Y' THEN audEmplStatus END) as AudEmplStatus
                ,MAX(CASE WHEN audEmplStatus = 'Y' THEN audDateTime END) as AudEmplStatusDate
                ,MAX(CASE WHEN audHourlyorSalary = 'Y' THEN audHourlyorSalary END) as audHourlyorSalary
                ,MAX(CASE WHEN audHourlyorSalary = 'Y' THEN audDateTime END) as audHourlyorSalaryDate
                ,MAX(CASE WHEN audDedGroupCode = 'Y' THEN audDedGroupCode END) as audDedGroupCode
                ,MAX(CASE WHEN audDedGroupCode = 'Y' THEN audDateTime END) as audDedGroupCodeDate
                ,MAX(CASE WHEN audCoID = 'Y' THEN audCoID END) as audCoID
                ,MAX(CASE WHEN audCoID = 'Y' THEN audDateTime END) as audCoIDDate
                FROM dbo.U_E2DOEBSWIF_Audit WITH (NOLOCK)
                GROUP BY audEEID, audKey2) AS Audit
        ON audEEID = xEEID
        AND audKey2 = XCOID
        
